    pairs = []
    for i in range(1, n + 1):
        for j in range(i + 1, n + 1):
            pairs.append([i, j])

    # Make a list of all possible pairs with distance less than k.
    less_k_pairs = []
    for i in range(len(pairs)):
        for j in range(len(pairs)):
            if (
                pairs[i][0]!= pairs[j][0]
                and pairs[i][1]!= pairs[j][1]
                and distances(pairs[i], pairs[j], graph, k)
            ):
                less_k_pairs.append(pairs[i])
                less_k_pairs.append(pairs[j])
    less_k_pairs = list(set(less_k_pairs))

    # Make a list of all possible pairs with distance greater than or equal to k.
    greater_or_equal_k_pairs = []
    for i in range(len(pairs)):
        for j in range(len(pairs)):
            if (
                pairs[i][0]!= pairs[j][0]
                and pairs[i][1]!= pairs[j][1]
