            ):
                greater_or_equal_k_pairs.append(pairs[i])
                greater_or_equal_k_pairs.append(pairs[j])

    # Calculate the total weight of all pairs.
    max_weight = 0
    for pair in less_k_pairs:
        weight = 0
        for i in range(len(pair) - 1):
