    def transpose(first, second):
        difference = 0
        for i in range(len(first)):
            if first[i]!= second[i]:
                difference = i
                break
        if abs(difference) == 1:
            return "Transposition"
        else:
            return "Nonsense"

    def inversion(first, second):
        for i in range(len(first)):
            if first[i]!= second[i]:
                if first[i] == first[0]:
                    first.pop(0)
                else:
                    first.pop(i)
                first.append(second[i])
                break
        if first == second:
            return "Inversion"
        else:
            return "Nonsense"

    def retrograde(first):
        first.reverse()
        if first == second_notes:
            return "Retrograde"
        else:
            return "Nonsense"

    rel = []
    rel.append(transpose(first, second))
    rel.append(inversion(first, second))
    rel.append(retrograde(first))

    return rel[0]

