    """
    Calculates the degree of a minimal-degree polynomial producing
    the original sequence of a polynomial and the value of the polynomial
    at the next regularly spaced input value.
    """

    def is_constant(sequence):
        """
        Determines if the sequence of differences is constant.
        :param sequence: Sequence of differences.
        :return: True if the sequence is constant, otherwise False.
        """
        differences = [
            sequence[0] - x for x in sequence[1:]
        ]
        if all([difference == differences[0] for difference in differences]):
            return True
        return False

    def create_sequence(sequence):
        """
        Creates a new sequence of differences from the input sequence.
        :param sequence: Sequence of values.
        :return: New sequence of differences.
        """
        new_sequence = []
        for x in range(len(sequence)):
            if x == 0:
                new_sequence.append(0)
            else:
                new_sequence.append(sequence[x] - sequence[x - 1])
        return new_sequence

    def find_degree(sequence):
        """
        Finds the degree of a minimal-degree polynomial producing the original
        sequence of a polynomial.
        :param sequence: Sequence of differences.
        :return: Degree of a minimal-degree polynomial producing the original
        sequence of a polynomial.
        """
        if is_constant(sequence):
            return 0
        differences = [
            sequence[0] - x for x in sequence[1:]
        ]
        for degree in range(1, len(sequence)):
            if all([
                differences[i] == differences[i - 1]
                for i in range(degree, len(differences))
            ]):
                return degree
        return None

    def polynomial(sequence, degree):
        """
        Calculates the value of a polynomial at the next regularly spaced
        input value.
        :param sequence: Sequence of differences.
        :param degree: Degree of a minimal-degree polynomial.
        :return: Value of a polynomial.
        """
        if degree == 0:
            return sequence[0] + sum(sequence[1:])
        if degree == 1:
            return sequence[0] + sum(sequence[1:]) + sequence[1]
        return sequence[0] + sum(sequence[1:]) + sequence[1] + sum([
            sequence[i] * i ** (degree - 1) for i in range(2, len(sequence))
        ])

    def main(sequence, _):
        """
        Calculates the degree of a minimal-degree polynomial producing the
        original sequence of a polynomial and the value of the polynomial
        at the next regularly spaced input value.
        :param sequence: Sequence of values.
        :return: Degree of a minimal-degree polynomial producing the original
        sequence of a polynomial and the value of the polynomial at the next
        regularly spaced input value.
        """
        sequence = create_sequence(sequence)
        degree = find_degree(sequence)
        if degree is None:
            return '1'+ str(sequence[-1])
        return str(degree) +'' + str(polynomial(sequence, degree))

    n, *values = [
        int(number)
        for number in stdin.split('\n')
    ]

    return main(values, n)

