    class Circle:
        def __init__(self, size):
            self.size = size
            self.counter = 0
            self.current_index = 0

        def __iter__(self):
            self.current_index = 0
            return self

        def __next__(self):
            self.current_index = (self.current_index + 1) % self.size
            self.counter += 1
            return self.counter

    def next_child(circle: Circle):
        return (circle.current_index + 1) % circle.size

    def throw(circle: Circle):
        next_child_index = next_child(circle)
        if k[0] == 0:
            return circle.counter
        else:
            return next_child_index

    def undo(circle: Circle):
        circle.counter -= 1

    circle = Circle(size=n)
    for command in commands:
        k = command.split(" ")
        if k[0] == "undo":
            undo(circle)
        else:
            throw(circle)
    print(next(circle))


