class Grid:
    def __init__(self, grid_string):
        self.grid = self.parse_grid(grid_string)
        self.rows, self.cols = len(grid_string), len(grid_string[0])
        self.start_index = self.get_start_index(grid_string)

    @staticmethod
    def parse_grid(grid_string):
        """
        >>> parse_grid("4 5\nCCCCC\nCCCCC\nCCCCC\nCCCCC")
        {0: {0: 'L', 1: 'L', 2: 'L', 3: 'L'}, 1: {0: 'L', 1: 'L', 2: 'L', 3: 'L'}, 2: {0: 'L', 1: 'L', 2: 'L', 3: 'L'}, 3: {0: 'L', 1: 'L', 2: 'L', 3: 'L'}}
        """
        grid = {}
        for row in range(len(grid_string)):
            for col in range(len(grid_string[0])):
                grid[row] = grid.get(row, {})
                grid[row][col] = grid[row].get(col, grid_string[row][col])
        return grid

    def get_start_index(self, grid_string):
        """
        >>> grid = Grid("4 5\nCCCCC\nCCCCC\nCCCCC\nCCCCC")
        >>> grid.get_start_index(grid.grid)
        {0: 0, 1: 0, 2: 1, 3: 1}
        """
        return {row: col for row, col in enumerate(grid_string[0]) if grid_string[0][col] == 'L'}

    def find_islands(self, start_index):
        """
        >>> g = Grid("4 5\nCCCCC\nCCCCC\nCCCCC\nCCCCC")
        >>> g.find_islands(g.start_index)
        """
        # Get starting row and column indices
        # Then mark as visited
        current_row, current_col = next(iter(start_index.items()))
        current_index = self.grid[current_row][current_col]
        self.grid[current_row][current_col] = 'V'
        # Perform depth first search
        self.__dfs(current_row, current_col, current_index)

    def __dfs(self, current_row, current_col, current_index):
        """
        >>> grid = Grid("4 5\nCCCCC\nCCCCC\nCCCCC\nCCCCC")
        >>> g = Grid("4 5\nCCCCC\nCCCCC\nCCCCC\nCCCCC")
        >>> g.find_islands(g.start_index)
        >>> g.grid
        {0: {0: 'L', 1: 'L', 2: 'L', 3: 'L'}, 1: {0: 'L', 1: 'L', 2: 'L', 3: 'L'}, 2: {0: 'L', 1: 'L', 2: 'L', 3: 'L'}, 3: {0: 'L', 1: 'L', 2: 'L', 3: 'L'}}
        """
        if current_index == 'L':
            self.grid[current_row][current_col] = 'W'
            if current_row < self.rows - 1 and self.grid[current_row + 1][current_col] == 'L':
                self.__dfs(current_row + 1, current_col, self.grid[current_row + 1][current_col])
            if current_row > 0 and self.grid[current_row - 1][current_col] == 'L':
                self.__dfs(current_row - 1, current_col, self.grid[current_row - 1][current_col])
            if current_col < self.cols - 1 and self.grid[current_row][current_col + 1] == 'L':
                self.__dfs(current_row, current_col + 1, self.grid[current_row][current_col + 1])
            if current_col > 0 and self.grid[current_row][current_col - 1] == 'L':
                self.__dfs(current_row, current_col - 1, self.grid[current_row][current_col - 1])
        elif current_index == 'W':
            self.grid[current_row][current_col] = 'C'
            if current_row < self.rows - 1 and self.grid[current_row + 1][current_col] == 'L':
                self.__dfs(current_row + 1, current_col, self.grid[current_row + 1][current_col])
            if current_row > 0 and self.grid[current_row - 1][current_col] == 'L':
                self.__dfs(current_row - 1, current_col, self.grid[current_row - 1][current_col])
            if current_col < self.cols - 1 and self.grid[current_row][current_col + 1] == 'L':
                self.__dfs(current_row, current_col + 1, self.grid[current_row][current_col + 1])
            if current_col > 0 and self.grid[current_row][current_col - 1] == 'L':
                self.__dfs(current_row, current_col - 1, self.grid[current_row][current_col - 1])
        elif current_index == 'C':
            self.grid[current_row][current_col] = 'V'

